import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav className="bg-red-500 px-6 py-4 flex justify-between items-center shadow-md">
      {/* Logo / Home */}
      <Link to="/" className="text-white text-2xl font-bold">
        üçï Pizza Delivery
      </Link>

      {/* Links */}
      <div className="flex items-center" style={{ gap: "3px" }}>
        {/* Home */}
        <Link
          to="/"
          className="text-lg font-semibold px-5 py-2 bg-white text-red-500 rounded-md hover:bg-gray-200 transition"
        >
          Home
        </Link>

        {/* Cart */}
        <Link
          to="/cart"
          className="text-lg font-semibold px-5 py-2 bg-white text-red-500 rounded-md hover:bg-gray-200 transition"
        >
          Cart
        </Link>

        {/* Custom Pizza */}
        <Link
          to="/custom-pizza"
          className="text-lg font-semibold px-5 py-2 bg-white text-red-500 rounded-md hover:bg-gray-200 transition"
        >
          Custom Pizza
        </Link>

        {/* Login */}
        <Link
          to="/login"
          className="text-lg font-semibold px-5 py-2 bg-yellow-400 text-black rounded-md hover:bg-yellow-300 transition"
        >
          Login
        </Link>

        {/* Register */}
        <Link
          to="/register"
          className="text-lg font-semibold px-5 py-2 bg-yellow-400 text-black rounded-md hover:bg-yellow-300 transition"
        >
          Register
        </Link>
      </div>
    </nav>
  );
};

export default Navbar;
